import React from 'react'
import Button from '@mui/material/Button';

const Header = () => {
  return (
    

    <header>
      <Button variant="contained">Hello world</Button>
    <p>Home</p>
    <p>About Me</p>
    <p>Gallery</p>
    <p>Skills</p>
</header>
  )
}

export default Header
